import styled from 'styled-components';

const ProductsSubCategoryStyles = styled.div`
  background: green;

  display: flex;
  flex-flow: row wrap;

  .sub-image {
    flex: 1 1 300px;
  }
`;

export { ProductsSubCategoryStyles };
